import React from 'react'
import './menu.scss'

export default function Menu() {

    let url="";

    return (
    <nav className='menuTop'>
        <ul>
            <li><a href={url}>Home</a></li>
            <li><a href={url}>About</a></li>
            <li><a href={url}>Destinations</a></li>
            <li><a href={url}>Contact</a></li>
        </ul>
    </nav>
    )
}
